/* ************************************ */
/* Define helper functions */
/* ************************************ */
var getInstructFeedback = function() {
  return '<div class = centerbox><p class = center-block-text>' + feedback_instruct_text + '</p></div>'
}

/* ************************************ */
/* Define experimental variables */
/* ************************************ */
// generic task variables
var sumInstructTime    = 0; // ms
var instructTimeThresh = 0; // seconds

// task specific variables
var stim = ''
var runTime  = 0  // ms
var taskTime = 900 // 15 minutes in seconds

/* ************************************ */
/* Set up jsPsych blocks */
/* ************************************ */

var bc_first_block = {
  type: 'poldrack-single-stim',
  stimulus: '<div class=centerbox><p class = center-block-text>Place your attention on the breath.</p>' + 
  '<p class = center-block-text>Press the down arrow after your first exhale as you count "one", ' +
  'then close your eyes and continue counting breaths and pressing the correct arrow key (1-8 = down, 9 = right).</p></div>',
  is_html: true,
  data: {
    trial_id: "breath_counting"
  },
  choices: [40, 39],     // 40 = down arrow, 39 = right arrow
  timing_response: -1,   // until response
  response_ends_trial: true,
  timing_post_trial: 0,
  on_finish: function() {
    jsPsych.data.addDataToLastTrial({'addingOnTrial': 'added!'})
  }
}
var bc_block = {
  type: 'poldrack-single-stim',
  stimulus: stim,
  is_html: true,
  data: {
    trial_id: "breath_counting"
  },
  choices: [40, 39],     // 40 = down arrow, 39 = right arrow
  timing_response: -1,   // until response
  response_ends_trial: true,
  timing_post_trial: 0,
  on_finish: function() {
    jsPsych.data.addDataToLastTrial({'addingOnTrial': 'added!'})
  }
}
var bc_node = {
  timeline: [bc_block],
  /* stopping criteria */
  loop_function: function(data) {
    for (i = 0; i < data.length; i++) {
      if ((data[i].trial_type == 'poldrack-single-stim') && (data[i].rt != -1)) {
        rt = data[i].rt
        runTime = runTime + rt
      }
    }
    // FIXME: Only times out on keypress _after_ duration
    console.log('runTime = ' + runTime);
    if (runTime <= taskTime * 1000) {
      return true
    } else if (runTime > taskTime * 1000) {
      return false
    }
  }
}
var beep = function() {
    var snd = new Audio("data:audio/wav;base64,");  
    snd.play();
}
var beep_block = {
  type: 'call-function',
  func: beep
}

//Set up post task questionnaire
var post_task_block = {
   type: 'survey-text',
   data: {
       trial_id: "post task questions"
   },
   questions: ['<p class = center-block-text style = "font-size: 20px">请总结一下您在此任务中被要求做什么。</p>',
              '<p class = center-block-text style = "font-size: 20px">您对此任务有任何意见吗？</p>'],
   rows: [15, 15],
   columns: [60,60]
};

/* define static blocks */
var end_block = {
  type: 'poldrack-text',
  data: {
    exp_id: "breath-counting-task",
    trial_id: "end"
  },
  text: '<div class = centerbox><p class = center-block-text>做得很好，谢谢您！您已完成了本次研究的这一部分。' +
'</p><p class = center-block-text>按 <strong>回车键</strong> 继续。</p></div>',
  cont_key: [13],
  timing_response: 180000,
  timing_post_trial: 0
};

var feedback_instruct_text =
  '欢迎参加实验。按 <strong>回车键</strong> 开始。'
var feedback_instruct_block = {
  type: 'poldrack-text',
  data: {
    trial_id: "instruction"
  },
  cont_key: [13],
  text: getInstructFeedback,
  timing_post_trial: 0,
  timing_response: 180000
};

/// This ensures that the subject does not read through the instructions too quickly.  If they do it too quickly, then we will go over the loop again.
var instructions_block = {
  type: 'poldrack-instructions',
  data: {
    trial_id: "instruction"
  },
  pages: [
    "<div class=centerbox><p class=block-text>在此任务中，我们希望您关注自己的呼吸。</p>" +
    "<p class=block-text>闭上眼睛，注意您是在吸气还是呼气，直到您数了三次呼吸（吸气和呼气为一次呼吸），然后睁开眼睛。</p></div>",
    "<div class=centerbox><p class=block-text>在此任务中计数呼吸时请使用相同的技巧。无需控制呼吸。只需正常呼吸即可。</p>" +
    "<p class=block-text>在某个时刻，您可能会注意到您的注意力从呼吸中游离。没关系。只需轻轻地将注意力重新放回到呼吸上。</p></div>",
    "<div class=centerbox><p class=block-text>为了帮助您保持对呼吸的注意，您将使用一小部分注意力" +
    "静静地从1到9计数呼吸，一遍又一遍。<strong><em>一次吸气和一次呼气合起来算作一次计数。</em></strong></p>" +  
    "<p class=block-text>在心中轻轻地默念计数，让它只获得少量注意力，而大部分注意力集中在感受呼吸上。</p>" +
    "<p class=block-text>在<strong>呼吸 1-8 时</strong>按一次<em><strong>下箭头键</strong></em>，" + 
    "在<strong>呼吸 9 时</strong>按一次<em><strong>右箭头键</strong></em>。这意味着您将随着每次呼吸按一次按键。" +
    "每次到达第 9 次呼吸时，重新从 1 开始计数。</p>" + 
    "<div><table><tr><td>呼吸次数</td><td>1</td><td>2</td><td>3</td><td>4</td><td>5</td><td>6</td><td>7</td><td>8</td><td>9</td><td>1</td><td>2</td><td>等等</td></tr>" +
    "<tr><td>按此键一次</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&darr;</td><td>&rarr;</td><td>&darr;</td><td>&darr;</td><td>等等</td></tr></table></div></div>",
    "<div class=centerbox><p class=block-text>我们建议您以舒适的直立、放松姿势坐着。</p>" +
    "<p class=block-text>将键盘放置在您可以舒适地将惯用手的食指和中指放在下箭头和右箭头键上的位置。</p>" +
    "<p class=block-text>任务将持续约15分钟。您的眼睛将闭着，因此会有声音提示任务结束。请确保您的计算机音量调高，以便能够听到结束提示音。</p></div>"
  ],
  allow_keys: false,
  show_clickable_nav: true,
  timing_post_trial: 500
};

var instruction_node = {
  timeline: [feedback_instruct_block, instructions_block],
  /* This function defines stopping criteria */
  loop_function: function(data) {
    for (i = 0; i < data.length; i++) {
      if ((data[i].trial_type == 'poldrack-instructions') && (data[i].rt != -1)) {
        rt = data[i].rt
        sumInstructTime = sumInstructTime + rt
      }
    }
    if (sumInstructTime <= instructTimeThresh * 1000) {
      feedback_instruct_text =
        'Read through instructions too quickly.  Please take your time and make sure you understand the instructions.  Press <strong>enter</strong> to continue.'
      return true
    } else if (sumInstructTime > instructTimeThresh * 1000) {
      feedback_instruct_text =
        'Done with instructions. Press <strong>enter</strong> to continue.'
      return false
    }
  }
}

/* create experiment definition array */

var breath_counting_task_experiment = [];
breath_counting_task_experiment.push(instruction_node);
breath_counting_task_experiment.push(bc_first_block);
breath_counting_task_experiment.push(bc_node);
breath_counting_task_experiment.push(beep_block);
breath_counting_task_experiment.push(end_block);
